response.about:
Люблю себя за то, что:

• никогда не теряю надежду;
• стараюсь не терять своё время впустую;
• стараюсь быть предельно честным по отношению к себе;
• стараюсь делать то, что мне приносит удовольствие;
• стараюсь всё время узнавать что-то новое, пробовать;
• во мне живёт добро;
• у меня есть заветные цели в жизни, которые я стремлюсь осуществить.
